import {Link} from 'react-router-dom'


function HeaderNav() {
  return (
    <nav className="navbar bg-body-tertiary mb-5 dens-nav-style">
        <div className="container-xl navi">
            <div className="nav-left-elems d-flex w-75 justify-content-between">
                <Link to="/" className="navbar-brand">РИЛИ мета</Link>
            </div>
        </div>
    </nav>
  );
}

export default HeaderNav;
